let ID = context.get('ID') || [];       // A unique identifier of the incomming message, which is indexed and spliced in unison with buffer
//Indicator for whether the buffer is waiting for a message to return or not
let waiting = context.get('waiting');  
if (waiting == undefined) {
    waiting = false; //Set the waiting or the current instance to false
    context.set('waiting', true); // Sets the next message that'll be recieved to wait
}

// Set paramarams
    //Sets the trigger msg member name and what the value of it is 
let msgTriggerName = 'lineFlag',
    msgTriggerValue = 'sqlHandshake',
    incommingUniqueIDmsgMember = 'machineID',
    outgoingUniqueIDmsgMember = 'machineID'

// Check for trigger
if (msg[msgTriggerName] == msgTriggerValue) {
    let index = ID.indexOf(msg[incommingUniqueIDmsgMember]);
    if (index != -1) { // Looking for the returned message in the context variables
        buffer.splice(index, 1);
        ID.splice(index, 1);
    } else {
        return null;
    }

    //Make copy of incoming message
    let msgCOPY = JSON.parse(JSON.stringify(msg));
    // Sets the next msg to go out (FIFO)
    msg = {
        ...buffer[0]
    }
    msg[outgoingUniqueIDmsgMember] = ID[0];

    context.set('buffer', buffer);
    context.set('ID', ID);

    //Testing checks //del
    msg.check = {
        buffer: buffer, 
        ID: ID,
        loop: loop
    }
    if (ID[0] == undefined) {
        context.set('buffer', []);
        context.set('ID', []);
        context.set('waiting', false);
        return [ ,msgCOPY]
    } else {
        return [msg, msgCOPY];
    }  
} else if (msg.topic == 'resetBuffer') {
    context.set('ID', undefined)
    context.set('buffer', undefined)
    context.set('waiting', false)
} else {

    // Add the incoming message payload and topic to the buffer
    let index = ID.indexOf(msg.machineID);
    if (index != -1) { // The message already exists
        buffer[index] = msg;
    } else {
        buffer.push(msg);
        ID.push(msg[incommingUniqueIDmsgMember]); 
    }


    // Set the buffer array back to context
    context.set('buffer', buffer);
    context.set('ID', ID);

    msg = {
        ...buffer[0]
    }
    msg.ID = ID;

    //Testing checks //del
    msg.check = {
        buffer: buffer,
        ID: ID,
        loop: loop
    }

    if (waiting) { // If we're waiting we do not return
    } else {
        if (buffer.length > 0)
            context.set('waiting', true);
            return [msg, ];       
    }
}

