    floatBufRegLength = [1],
    arr = [];

// Reading it the right way
for (let i = 0; i < charBuf.length; i++) { // Go through character calls
    let text = "";

    /*//Doesn't work with Delta, seems they switch the high and low bits of a register
    for (let i = offset; i < offset + entryRegisterLength * 2; i++) { // 2 buffers for every register
        text += String.fromCharCode(msg.payload.buffer[i]);
    }
    */
    for (let j = 0; j < charBufRegLength[i] * 2; j++) { // 2 buffers for every register
        text += String.fromCharCode(charBuf[i][j + 1]);
        text += String.fromCharCode(charBuf[i][j]);
        j++;
    }
    charValues.push(text);
}

const offset = 4; // buffer length of a Float
let buf,
    floatValues = [];

for (let i = 0; i < floatBufRegLength.length; i++) {
    for (let j = 0; j < floatBufRegLength[i]; j++) {
        //The way Node-Red writes it
        //buf = Buffer.from(msg.payload.buffer.slice(i * offset, i * offset + offset));
        //Our PLCs seem to read them backwards (2nd reg first)
        buf = floatBuf[i].slice(j * offset, j * offset + offset);
        buf = [buf[2], buf[3], buf[0], buf[1]];
        buf = Buffer.from(buf);
        arr.push(buf.readFloatBE());
    }
    floatValues.push(arr);
    arr = [];
}


